var _modules = require('ui/modules');

var _xpack_info = require('plugins/xpack_main/services/xpack_info');

var _logstash_security_service = require('./logstash_security_service');

_modules.uiModules.get('xpack/logstash').factory('logstashSecurityService', function ($injector) {
  var Private = $injector.get('Private');
